import { Button, Space } from 'antd';

function ContractInteraction(props) {
    console.log(props);
    return (
        <div>
            <div>test</div>
            <div>{props.address}</div>
            <Space direction="vertical">
                {/* None of the methods have inputs so they can just be buttons */}
                {/* Add icons to make them more interesting */}
                <Button>Check Heartbeat</Button>
                <Button>Add Time</Button>
                <Button>Defuse</Button>
                <Button>Renounce Ownership</Button>
                <Button>Get URL</Button>
                <Button>Set Url</Button>
                <Button>Reveal Decryption Key</Button>
            </Space>
        </div>
    );
}

export default ContractInteraction;
